        React.createElement("path", { d: "M2.92 4.13A2.25 2.25 0 015.17 2h1.16c1.2 0 2.18.93 2.25 2.13l.83 15.5A2.25 2.25 0 017.17 22H4.33a2.25 2.25 0 01-2.24-2.37l.83-15.5zM9.52 22h10.23c1.24 0 2.25-1 2.25-2.25V6a.75.75 0 00-1.26-.55l-5.24 4.84V6a.75.75 0 00-1.26-.55L9.87 9.49l.54 10.08c.05.94-.3 1.8-.9 2.43zM13 16a1 1 0 011-1h4a1 1 0 011 1v4.5h-6V16z", fill: primaryFill }));
};
const BuildingFactory24Filled = wrapIcon(rawSvg({}), 'BuildingFactory24Filled');
export default BuildingFactory24Filled;
